import ImageOne from '../images/ImageOne.jpg';
import ImageTwo from '../images/ImageTwo.jpg';
import ImageThree from '../images/ImageThree.jpg';
import ImageFour from '../images/ImageFour.jpg';

export const SliderData = [
    {
        title: 'Best skiresorts in Austria, KITZBÜHEL',
        altitude: 'Between 800 and 2400 metres',
        path: '/areas',
        label: 'View ski area',
        image: ImageOne,
        alt:'Kitzbühel'
    },

    {
        title: 'Best skiresorts in Austria, SAALBACH HINTERGLEMM LEOGANG FIEBERBRUNN',
        altitude: 'Between 830 and 2096 metres',
        path: '/areas',
        label: 'View ski area',
        image: ImageTwo,
        alt:'Saalbach Hinterglemm Leogang Fieberbrunn'
    },

    {
        title: 'Best skiresorts in Austria, ZELL AM SEE',
        altitude: 'Between 757 and 2000 metres',
        path: '/areas',
        label: 'View ski area',
        image: ImageThree,
        alt:'Zell Am See'
    },

    {
        title: 'Best skiresorts in Austria, SÖLDEN',
        altitude: 'Between 1350 and 3244 metres',
        path: '/areas',
        label: 'View ski area',
        image: ImageFour,
        alt:'Sölden'
    },
];

